import '../App.css'
import logo from '../img/logo2.png'
export default function Front(){
    return(
        <div class="front">
            <section className='half'><b>Hi there,</b><br/>this is anoop </section>
            <section className='logo half'><img src={logo} alt="" /></section>
        </div>
    )
}
